import React from 'react';

const OrderItem = ({order}) => {
    return (
        <div className="p-2 m-1 d-flex justify-content-between" style={{border:"solid 3px black"}}>

            <div>
                {order.id}
            </div>
            <div className="d-flex justify-content-between" style={{fontSize:12}}>
                <div>
                    {order.status}

                </div>
                <div>
                    {order.date}
                </div>

            </div>
        </div>
    );
};

export default OrderItem;
